import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { makeStyles } from '@material-ui/core/styles';
import './fonts.css';
import {background, secondary} from './colors.js';

const useStyles = makeStyles((theme) => ({
  appBarTheme : { 
    flexGrow: 1
  },
  buttonTheme : { 
    color: secondary,
    fontWeight: "bold",
    fontFamily: "Montserrat",
    verticalAlign: 'bottom',
    display: 'inline-block',
    width: '7%',
    fontSize: '0.7em',
    letterSpacing: '0.1em'
  },
  circle: {
    position: 'absolute',
    top: '50%',
    left: theme.spacing(2),
    transform: 'translateY(-50%)',
    width: '24px',
    height: '24px',
    borderRadius: '50%',
    backgroundColor: 'red', // Replace with your desired color
  },
}));
const firstLetter = { fontSize: '1.3em' };

export default function SimpleAppBar() {
  const classes = useStyles();
  return (
    <Box className={"classes.appBarTheme"}>
      <AppBar position="static" sx={{background: background, boxShadow:'none'}}>
        <Toolbar>
          <div className={classes.circle}></div>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            EV
          </Typography>
          <Button className={"classes.buttonTheme"}><span style={firstLetter} >C</span>ontact</Button>
          <Button className={"classes.buttonTheme"}><span style={firstLetter} >L</span>inks</Button>
          <Button className={"classes.buttonTheme"}><span style={firstLetter} >R</span>esume</Button>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
